export const Quicksand = (doc) => {
    const normalFontBase64 = ""; // Replace with base64 of Quicksand
    const boldFontBase64 = ""; // Replace with base64 of Quicksand-Bold

    const mediumFontBase64 = "";
    const semiBoldFontBase64 = "";
    const lightFontBase64 = "";

    // Add both normal and bold fonts
    doc.addFileToVFS("Quicksand.ttf", normalFontBase64);
    doc.addFileToVFS("Quicksand-Medium.ttf", mediumFontBase64);
    doc.addFileToVFS("Quicksand-SemiBold.ttf", semiBoldFontBase64);
    doc.addFileToVFS("Quicksand-Light.ttf", lightFontBase64);
    doc.addFileToVFS("Quicksand-Bold.ttf", boldFontBase64);

    // Add both fonts to jsPDF
    doc.addFont("Quicksand.ttf", "Quicksand", "normal");
    doc.addFont("Quicksand-Bold.ttf", "Quicksand", "bold");
    doc.addFont("Quicksand-Medium.ttf", "Quicksand", "medium");
    doc.addFont("Quicksand-SemiBold.ttf", "Quicksand", "semibold");
    doc.addFont("Quicksand-Light.ttf", "Quicksand", "light");

};
